
SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `oid` int(11) NOT NULL AUTO_INCREMENT,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `name` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `surname` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `email` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `address` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `color` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `ram` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `ssd` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `hdd` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `gpu` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `cpu` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`oid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf16 COLLATE=utf16_unicode_ci;

